*Город*: Санкт-Петербург
*Вакансия*: Senior Data Analyst / Ведущий аналитик данных
*Компенсация*: от 150 000 до 200 000 руб (готовы рассматривать мидлов на вырост от 100 000 руб)

*Компания*: Adhack – независимая компания-разработчик решений для анализа данных и автоматизации процессов в дистрибуции цифровых продуктов. Уже сегодня наши решения помогают вести рекламные кампании по всему миру для компаний в составе Alibaba Group, Amazon, Joom, Topface и многих других.

*Вам предстоит*:
– В плотном сотрудничестве с командой маркетинга и продукта формулировать гипотезы и искать ответы на вопросы в данных рекламных кампаний;
– Закрывать обширный спектр задач из области data science: строить новые и улучшать существующие рекомендательные системы, скоринговые модели.

*Мы ждём от вас*:
– Высшее математическое или техническое образование;
– Владение методами прикладной статистики, теории вероятностей и машинного обучения;
– Опыт участия в разработке рекомендательных систем и систем автоматизации;
– Высокий уровень владения SQL;
– Знание Python;
– Английский язык не ниже уровня Intermediate;
– Системное мышление, высокой самодисциплины и самостоятельности.

*Мы предлагаем*:
– Нетривиальные задачи в масштабном проекте;
– Достойную компенсацию и квартальные премии в размере до 1 оклада за результат;
– Реальные возможности карьерного и личностного роста в команде high-level профессионалов;
– ДМС высокой категории со стоматологией после испытательного срока;
– Бесплатные занятия йогой, кроссфитом, корпоративный отдых, компенсация питания;
– Офис с зонами отдыха, массажным креслом, душем, кухней и возможностью зарубиться с коллегами в кикер, игры на PS4 или VR;
– Комфортный график работы.

